    state2 = {data: "fa-solid fa-left-right" }
   render(){ 
    return(
        <div id="rec-stays">
            <h1>Recommended Stays</h1> 
            <Button icon = {this.state1.data}  />
            <Rental />
            <Rental />
            <Rental />
            <Button icon = {this.state2.data} />
                     
        </div>
    );
    }
}

export default Recommended;
